css:
@-moz-document domain("devforum.roblox.com")
{
.logo-big,
#site-logo:not(.logo-small) {
    display: block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background: url(https://cdn.discordapp.com/attachments/498842282766630912/680746585310756884/coefficients.png);
    width: 187px !important;
    height: 40px !important;
    padding-left: 187px;
    background-size: 187px 40px;
}

.logo-small {
    display: block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background: url(https://cdn.discordapp.com/attachments/460070023831224325/680818243933569051/coefForum.png);
    width: 40px !important;
    height: 40px !important;
    padding-left: 40px;
    background-size: 40px 40px;
}
.d-header-icons .icon img.avatar {

    display: block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background: url(https://cdn.discordapp.com/attachments/971520421851697193/971527077369106432/unknown.png?size=4096);
    width: 40px !important;
    height: 40px !important;
    padding-left: 40px;
    background-size: 40px 40px;
}
}
